import styles from './Home.module.scss';

const Home = () => {
  return (
    <div className={styles.home}>
      <div className={styles.intro}>
        <img
          className={`${styles.img}`}
          src="../../../uploads/dice-ranking-list-featured.png"
        />
      </div>
    </div>
  );
};

export default Home;
